import React from "react";
import { useAuth } from "../useAuth";

function Logout(props) {
  // Destructing our hook to get the `logout` function
  const { logout } = useAuth();

  return (
    <button
      onClick={() => {
        if (props) {
          props.setEmail("");
          props.setUser("");
        }

        logout();
      }}
    >
      Logout
    </button>
  );
}

export default Logout;
